import React from 'react';


interface TodoListItemProps{
todo:{
    text:string;
    complete:boolean;
};

}
export const ToDolistItem:React.FC<TodoListItemProps> =({todo})=>{
    return (
    <li>
        <label>
            <input type="checkbox" checked={todo.complete} /> 
            {todo.text}
            </label>
            </li>
    );
};
